    data: |
      SELECT ALL col0 / ( - col0 ) * + 30 AS col1, + ( + col1 ) * - 68 AS col0 FROM tab0;
  - name: tab0

outputs:
  - name: q5334.out
    data: |
      -30	-1428
      -30	-5508
      -30	-68
